import  './Card.css';

const Card = ({allVideoGamer})=>{


    return (
        <div className='principal'>
            <div className="containerCard">
            <img src={allVideoGamer.background_image} alt={allVideoGamer.name} className='imagengame'/>
            <div className='submenuCard'>
                <div>{allVideoGamer.name}</div>
                <div>{allVideoGamer.genres}</div>
            </div>
        </div>
        </div>
        
    )
}


export default Card;
